const map={
	"t":"+",
	"1":"!",
	"f":"?",
	"L":"-",
	";":";",
	":":":",
	",":"_",
	"i":"&",
	".":"#",
	" ":"@"
}
const rmap=Object.fromEntries(Object.entries(map).map(([k,v])=>[v,k]))
function long(st){
	let re=st.split(",")
	let res=""
	re.forEach(e=>{
		let chr=e[e.length-1]
		let num=e.replace(chr,"")
		if(chr==undefined)return res+=" ";
		res+=new Array(parseInt(num,36)).fill(rmap[chr]).join("")
	})
	return res
}
async function rrl(){
	const frames=n.length;
	for(let i=0;i<frames;i++){
		let frame=n[i].split("|").map(e=>long(e)).join("\n")
		document.getElementById("output").innerHTML="<font color=#fff><pre>"+frame+"</pre></font>";
		await delay(100);
	}
	rrl();
}
